import React, { useEffect, useRef } from 'react';

interface Point {
  x: number;
  y: number;
  baseX: number;
  baseY: number;
  vx: number;
  vy: number;
}

const InteractiveLines: React.FC = () => {
  const canvasRef = useRef<HTMLCanvasElement>(null);
  const mousePos = useRef({ x: 0, y: 0 });
  const lastMousePos = useRef({ x: 0, y: 0 });
  const isDragging = useRef(false);
  const points = useRef<Point[][]>([]);
  const animationFrameId = useRef<number>();

  useEffect(() => {
    const canvas = canvasRef.current;
    if (!canvas) return;

    const ctx = canvas.getContext('2d');
    if (!ctx) return;

    const setCanvasSize = () => {
      const pixelRatio = window.devicePixelRatio || 1;
      const rect = canvas.getBoundingClientRect();
      canvas.width = rect.width * pixelRatio;
      canvas.height = rect.height * pixelRatio;
      ctx.scale(pixelRatio, pixelRatio);
      canvas.style.width = `${rect.width}px`;
      canvas.style.height = `${rect.height}px`;
      initGrid();
    };

    const initGrid = () => {
      const gridSize = 25;
      const cols = Math.floor(canvas.width / gridSize) + 2;
      const rows = Math.floor(canvas.height / gridSize) + 2;

      points.current = [];
      for (let i = 0; i < cols; i++) {
        const col: Point[] = [];
        for (let j = 0; j < rows; j++) {
          col.push({
            x: i * gridSize,
            y: j * gridSize,
            baseX: i * gridSize,
            baseY: j * gridSize,
            vx: 0,
            vy: 0
          });
        }
        points.current.push(col);
      }
    };

    const updatePoints = () => {
      const friction = 0.85;
      const springStrength = 0.1;
      const mouseRadius = 150;
      const mouseStrength = isDragging.current ? 0.25 : 0.1;

      for (let i = 0; i < points.current.length; i++) {
        for (let j = 0; j < points.current[i].length; j++) {
          const point = points.current[i][j];
          
          // Mouse influence
          const dx = mousePos.current.x - point.x;
          const dy = mousePos.current.y - point.y;
          const distance = Math.sqrt(dx * dx + dy * dy);
          
          if (distance < mouseRadius) {
            const force = (1 - distance / mouseRadius) * mouseStrength;
            point.vx += dx * force;
            point.vy += dy * force;
          }

          // Spring force back to original position
          const springX = (point.baseX - point.x) * springStrength;
          const springY = (point.baseY - point.y) * springStrength;
          
          point.vx += springX;
          point.vy += springY;

          // Apply velocity with friction
          point.vx *= friction;
          point.vy *= friction;
          
          // Update position
          point.x += point.vx;
          point.y += point.vy;
        }
      }
    };

    const handleMouseDown = (e: MouseEvent) => {
      isDragging.current = true;
      updateMousePosition(e);
      lastMousePos.current = { ...mousePos.current };
    };

    const handleMouseUp = () => {
      isDragging.current = false;
    };

    const updateMousePosition = (e: MouseEvent) => {
      const rect = canvas.getBoundingClientRect();
      const scaleX = canvas.width / rect.width;
      const scaleY = canvas.height / rect.height;
      
      mousePos.current = {
        x: (e.clientX - rect.left) * scaleX,
        y: (e.clientY - rect.top) * scaleY
      };
    };

    const handleMouseMove = (e: MouseEvent) => {
      updateMousePosition(e);
    };

    const animate = () => {
      ctx.clearRect(0, 0, canvas.width, canvas.height);
      
      updatePoints();

      // Draw lines
      ctx.strokeStyle = 'rgba(0, 0, 255, 0.3)';
      ctx.lineWidth = 0.8;

      // Vertical lines
      for (let i = 0; i < points.current.length; i++) {
        ctx.beginPath();
        ctx.moveTo(points.current[i][0].x, points.current[i][0].y);
        
        for (let j = 1; j < points.current[i].length; j++) {
          const point = points.current[i][j];
          const prevPoint = points.current[i][j - 1];
          const xc = (point.x + prevPoint.x) / 2;
          const yc = (point.y + prevPoint.y) / 2;
          
          ctx.quadraticCurveTo(prevPoint.x, prevPoint.y, xc, yc);
        }
        ctx.stroke();
      }

      // Horizontal lines
      for (let j = 0; j < points.current[0].length; j++) {
        ctx.beginPath();
        ctx.moveTo(points.current[0][j].x, points.current[0][j].y);
        
        for (let i = 1; i < points.current.length; i++) {
          const point = points.current[i][j];
          const prevPoint = points.current[i - 1][j];
          const xc = (point.x + prevPoint.x) / 2;
          const yc = (point.y + prevPoint.y) / 2;
          
          ctx.quadraticCurveTo(prevPoint.x, prevPoint.y, xc, yc);
        }
        ctx.stroke();
      }

      animationFrameId.current = requestAnimationFrame(animate);
    };

    setCanvasSize();
    window.addEventListener('resize', setCanvasSize);
    canvas.addEventListener('mousedown', handleMouseDown);
    canvas.addEventListener('mouseup', handleMouseUp);
    canvas.addEventListener('mousemove', handleMouseMove);
    canvas.addEventListener('mouseleave', handleMouseUp);

    animate();

    return () => {
      window.removeEventListener('resize', setCanvasSize);
      canvas.removeEventListener('mousedown', handleMouseDown);
      canvas.removeEventListener('mouseup', handleMouseUp);
      canvas.removeEventListener('mousemove', handleMouseMove);
      canvas.removeEventListener('mouseleave', handleMouseUp);
      if (animationFrameId.current) {
        cancelAnimationFrame(animationFrameId.current);
      }
    };
  }, []);

  return (
    <canvas
      ref={canvasRef}
      style={{
        width: '100%',
        height: '100%',
        background: '#ffffff',
        cursor: 'grab',
      }}
    />
  );
};

export default InteractiveLines;
